import styled from 'styled-components';

export const Title = styled.h1`
  margin: 20px 0;
  font-size: 30pt;
  color: #6665DD;
`;
export const SubTitle = styled.h1`
  margin: 20px 0;
  font-size: 20pt;
  color: #6665DD;
`;
export const Boxtype = styled.div`
  border: 1px solid #6665DD;
  margin: 20px 0;
  font-size: 20pt;
  color: #6665DD;
`;
